import React from 'react';
import './style.less'

export default function TopHeader() {
  return (
    <div className="top clearfix">
      <div className="top-left">
          <img className="logo" src={require("../../assets/images/white-title.png")} alt="" />
          <a href=""></a>
      </div>
      <div className="top-right"></div>
    </div>
  );
}
